angular.module('mg.templates', []).run(['$templateCache', function($templateCache) {
  $templateCache.put("app/faces/faces.tpl.html",
    "<div class=page-header><h2>Faces i've seen</h2></div><div class=jumbotron>{{test}}</div>");
  $templateCache.put("app/login/login.tpl.html",
    "<div class=container><div class=row><div class=\"center-form panel\"><div class=panel-body><h2 class=text-center>Log in</h2><form method=post ng-submit=login() name=loginForm><div class=\"form-group has-feedback\"><input class=\"form-control input-lg\" name=email ng-model=email placeholder=Email required autofocus> <span class=\"ion-at form-control-feedback\"></span></div><div class=\"form-group has-feedback\"><input class=\"form-control input-lg\" type=password name=password ng-model=password placeholder=Password required> <span class=\"ion-key form-control-feedback\"></span></div><button type=submit ng-disabled=loginForm.$invalid class=\"btn btn-lg btn-block btn-success\">Log in</button><br><p class=text-center><a href=#>Forgot your password?</a></p><p class=\"text-center text-muted\"><small>Don't have an account yet? <a href=/#/signup>Sign up</a></small></p><div class=signup-or-separator><h6 class=text>or</h6><hr></div></form><button class=\"btn btn-block btn-facebook\" ng-click=\"authenticate('facebook')\"><i class=ion-social-facebook></i> Sign in with Facebook</button> <button class=\"btn btn-block btn-google-plus\" ng-click=\"authenticate('google')\"><span class=ion-social-googleplus></span>Sign in with Google</button></div></div></div></div>");
  $templateCache.put("app/places/places.tpl.html",
    "<div class=page-header><h2>Places i've been</h2></div><pre ng-if=false class=code>{{model | json}}</pre><div class=row><div class=\"col-md-offset-4 col-md-4\"><div class=input-group><input class=form-control ng-model=model.selected> <span class=input-group-btn><button class=\"btn btn-success\" ng-click=add(model.selected) type=button>Add</button></span></div><div class=\"list-group margin-top-20\" ng-repeat=\"place in model.places\"><a ng-href=http://en.wikipedia.org/wiki/{{place.name}} class=list-group-item target=_blank><h4 class=list-group-item-heading>{{place.address}}</h4><p class=list-group-item-text><span class=\"climacon thermometer\" ng-class=\"{'low':place.temp<0,'medium-low':place.temp>0,'high':place.temp>10,'full':place.temp>20}\" style=\"font-size: 2em\"></span>Temperature:{{place.temp}} Coordinates:{{place.latitude}},{{place.longitude}}</p></a></div></div></div>");
}]);
